import React, { Component, useState } from "react";
import { Card } from "antd";
import ChecklistItem from "./ChecklistItem";

const ChecklistAccordionSub = (props2) => {
  const [test, useTest] = useState(false);
  // console.log(questions);
  return (
    <Card.Body>
      <h6>
        <b>{props2.title2}</b>
      </h6>
      {props2.questions.map((question) => {
        return (
          <ChecklistItem
            question={question}
            globalDispatch={props2.globalDispatch}
            title={props2.title}
          />
        );
      })}
    </Card.Body>
  );
};

export default ChecklistAccordionSub;
